function test_omit() {
    $exchange = new \ccxt\async\Exchange(array(
        'id' => 'sampleexchange',
    ));
    assert_deep_equal($exchange, null, 'testOmit', $exchange->omit(array(), 'foo'), array());
    assert_deep_equal($exchange, null, 'testOmit', $exchange->omit(array(
        'foo' => 2,
    ), 'foo'), array());
    assert_deep_equal($exchange, null, 'testOmit', $exchange->omit(array(
        'foo' => 2,
        'bar' => 3,
    ), 'foo'), array(
        'bar' => 3,
    ));
    assert_deep_equal($exchange, null, 'testOmit', $exchange->omit(array(
        'foo' => 2,
        'bar' => 3,
    ), ['foo']), array(
        'bar' => 3,
    ));
}
